import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";

import { useUser } from "./Components/utils/global.context";

import { Outlet } from "react-router-dom";


function App() {
  const [user] = useUser();
  return (
      <div className={`App ${user.theme}`}>
          <Navbar/>
          <Outlet/>
          
          <Footer/>
      </div>
  );
}

export default App;
